export default function Footer(){
    return(
        <footer className="text-center d-flex row flex-column">
        <div className="flex mt-6 justify-center">
            <hr className="hr-footer-line rounded" />
        </div>                
        <p
            className="text-light opacity-3 mx-auto">
            Copyright.
        </p>
    </footer>          
    );
}
